import React from "react";
import { Route, Switch } from "react-router-dom";
import MyNavbar from "./navbar/MyNavbar.js";
import Home from "./homepage/Home.js";

export default () => {
    return(
        <div>
            <MyNavbar />
            <Switch>
                <Route path="/" component={Home}/>
            </Switch>
        </div>
    )
}
